            text: '### Parte 2: Identificando as ordens de insetos\n\nVocê utilizará uma chave pictórica de identificação. Esse tipo de chave combina a descrição em forma de texto com ilustrações. As estruturas importantes para a identificação da ordem estão em destaque nas ilustrações.\n\nFicou em dúvida com algum termo? Consulte o glossário disponível no final do guia de campo e confira a definição das palavras que estão sublinhadas no texto.\n\nDica importante: Se o inseto estiver em repouso, as asas posteriores podem estar parcial ou totalmente cobertas pelas asas anteriores. Fique atento a esse detalhe para não se confundir no momento da identificação.\n\nOs vetores e imagens utilizados são de autoria dos autores do trabalho ou foram retirados dos sites [Freepik](https://br.freepik.com), [OpenVerse](https://openverse.org) e [Pexels](https://www.pexels.com), no modo de licença creative commons. Observe as fotografias que você obteve do inseto e encontre entre as opções aquela que descreve a ordem encontrada:\n\n### Opção 1:\n\nOlhos compostos, geralmente ocupando a maior parte da cabeça. Um par de asas membranosas desenvolvidas e visíveis; pernas de tamanho normal ou alongadas.',
