            groupId: 8,
            text: '### Parte 7: textura do solo\n\nO solo possui diferentes texturas, dependendo da proporção dos grãos de areia, silte e argila que o compõe. Pegue o solo que está sobre a lona, umedeça com água e amasse bem na mão. Depois identifique a sensação tátil ao esfregar a amostra de solo, molhada e amassada, entre os dedos polegar e indicador **(figura 10 - sequência do procedimento para avaliar a textura do solo da amostra.)**. Nesse solo, você sente os grãos de areia? É mais sedoso? É áspero? É pegajoso?\n\nVeja as definições dos diferentes grupos de textura que estão no formulário:\n\n - arenoso;\n - argiloso;\n - siltoso;\n - médio;\n\nEm qual deles o seu solo se encaixa melhor?',
