            id: 346,
            groupId: 8,
            text: '### Parte 8: acidez e alcalinidade do solo\n\nNesta atividade você deve identificar o pH do solo, ou seja, determinar se o solo é ácido (como um limão) ou é alcalino (como o sabão em pó). O pH varia de 0 a 14, sendo que quanto menor é mais ácido e quanto maior é mais alcalino.\n\nPara realizar este teste você poderá utilizar um destes dois métodos (escolha apenas um deles):\n\n- Método 1 - Papel indicador de pH (método preferencial);\n- Método 2 - Vinagre e bicarbonato de sódio (método alternativo). Se for utilizar o método 1 (papel indicador), em copo de cafezinho de 50 mL, coloque solo e água na mesma proporção, misture com um palito de sorvete e deixe parado por alguns minutos, com o papel indicador imerso nesta mistura. Depois de um a dois minutos, tire o papel indicador e compare com a escala que está na caixa do papel indicador para identificar o pH do solo.\n\nCaso não tenha o papel indicador de pH, utilize o método 2 com o uso de vinagre e bicarbonato de sódio.\n\nPegue um pouco de solo que está sobre a lona e coloque em dois copos descartáveis de 200 mL. Em um primeiro copo coloque solo + água + 1 colher de sopa de bicarbonato de sódio (encontrado em farmácias ou empórios). Misture bem com um palito de sorvete por uns 2 minutos. Se formarem várias bolhas no copo que foi adicionado bicarbonato de sódio, então o solo é ácido, que é o tipo mais comum no Brasil. No segundo copo adicione solo + água + 3 colheres de sopa de vinagre comum. Misture bem com um palito de sorvete por uns 2 minutos. Se no copo com vinagre formarem bolhas, o solo é alcalino. É menos comum este solo no Brasil, mas a cal e o cimento, utilizados na construção da escola, podem ter deixado o solo alcalino. Porém, caso o solo não forme bolhas nem com adição do vinagre, nem com adição do bicarbonato de sódio, esse solo é neutro.',
